import Home from './screens/HomeScreen'
import { AppLoading } from 'expo';
import Navigator from './route/vesnaStack'

const getFonts = () => Font.loadAsync({
  'amsterdam-laviera': require('./assets/fonts/Amsterdam Laviera.ttf'),
  'southern-aire': require('./assets/fonts/SouthernAire_Personal_Use_Only.ttf')
});

export default function App() {
  const [fontsLoaded, setFontsLoaded] = useState(false);

  if(fontsLoaded){
    return (
      <Navigator />
    );
  } else {
    return (
      <AppLoading
        startAsync={getFonts}
        onFinish={() => setFontsLoaded(true)}
      />
    )
  }
}
